import { useEffect } from "react"
import { useParams } from "react-router-dom"
export function select_page(){
    const {article_page}=useParams()
    if(!article_page){
        return(
            <Employee_orignal/>
        )
    }
    else{
        return(
            <Employee_after/>
        )
    }
}

export function Employee(){



    return(
        select_page()
    )
}
export function Employee_orignal(){
    return(
        <div>
            Origin
        </div>
    )
}
export function Employee_after(){
    return(
        <div>after</div>
    )
}
